import React from 'react';


const TodoList = ({todoList,task}) =>{
    const filterTodoList = todoList.filter(value => value.toLowercase()===task.toLowercase())
  return <div>
      <ul>
      {todoList.map((item,index)=>(
          <li key={index}>{item}</li>
      ))}
        </ul>
  </div>;
}

export default TodoList;
